import React from 'react';
import './log.css';
import Background from './skyline.jpg';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap';

const Login = () => {
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);

  const url = 'https://json-storage-api.p.rapidapi.com/datalake';
const options = {
	method: 'POST',
	headers: {
		'content-type': 'application/json',
		'X-RapidAPI-Key': '66d105c179msh9c5b82c1cf62460p15aa72jsn63c558e1dc1e',
		'X-RapidAPI-Host': 'json-storage-api.p.rapidapi.com'
	},
	body: {
		'@context': [
			'http://schema4i.org/Thing.jsonld',
			'http://schema4i.org/Action.jsonld',
			'http://schema4i.org/CreateAction.jsonld'
		],
		'@type': 'CreateAction',
		Result: {
			'@context': [
				'http://schema4i.org/DataLakeItem.jsonld',
				'http://schema4i.org/UserAccount.jsonld',
				'http://schema4i.org/OfferForPurchase.jsonld',
				'http://schema4i.org/Offer.jsonld',
				'http://schema4i.org/Organization.jsonld',
				'http://schema4i.org/PostalAddress.jsonld'
			],
			'@type': 'DataLakeItem',
			Name: 'X-PLOR Group',
			Creator: {
				'@type': 'UserAccount',
				Identifier: 'USERID-4711'
			},
			About: {
				'@type': 'Organization',
				Name: 'X-PLOR GmbH',
				Address: {
					'@type': 'PostalAddress',
					StreetAddress: 'Lindenstrasse',
					HouseNumber: '48-52',
					PostalCode: '40233',
					AddressLocality: 'Duesseldorf',
					AddressCountry: 'D'
				}
			}
		}
	}
};

const fetchData = async () => {
  try {
    const response = await fetch(url, options);
    const result = await response.text();
    console.log(result);
  } catch (error) {
    console.error(error);
  }
};

fetchData();

    return (
      <row>
      <Container fluid>
      <Col md={0} ></Col>
      <Col md={20}>
        <form>
        <div class="bg-image"> 
        <div class="row row-cols-1 row-cols-md-2 g-4">
        <div class="col shadow p-3 mb-5 bg-body-tertiary rounded fromtable" >
        <div class="mb-3" className='login'>
          <h4 style={{padding: "10px"}}>Wellcome</h4>
          <label for="usernam" class="form-label" style={{padding: "10px"}} >User Name</label>
          <input type="username" class="form-control" id="exampleInputusername" aria-describedby="username" />
          <label for="password" class="form-label" style={{padding: "10px"}} >Password</label>
          <input type="password" class="form-control" id="exampleInputPassword1"  />
          <br></br>
          <br></br>
          <Link to="/Transaction">
        <button type="submit" class="btn btn-secondary" >Login</button>
        </Link>
        <br></br>
        <br></br>
        <br></br>
        </div>
        </div>
        </div>
        </div>
      </form>
      </Col>
            </Container>
            </row>

    );
};

export default Login;
